INSERT INTO `courses` VALUES (6,1,6,'Программирование на Java. Углубленный уровень','JD02 Программирование на Java. Углубленный уровень','JD02',10,0,'На этом курсе вам предстоит изучить базы данных и XML, а также шаблоны проектирования. Все это пригодится для создания сложных консольных приложений и поможет подготовиться к созданию веб-приложений.',32),(7,1,7,'Java Server Pages & Servlets','JD03 Java Server Pages & Servlets','JD03',10,0,'Изучите основы веб-программирования, сможете создавать свои сайты с применением современных технологий (Servlet, JSP).',36),(5,1,5,'Программирование на Java. Базовый уровень','JD01 Программирование на Java. Базовый уровень','JD01',10,0,'Вы изучите основы Java, будете создавать простейшие консольные приложения.',40),(8,41,1008,'Тестирование для начинающих','ST01 Тестирование для начинающих','ST01',10,0,'Вы узнаете, как тестировать документацию, создавать тест-кейсы, писать отчёты о дефектах, и что означают все эти \"страшные\" слова.',36),(9,41,2009,'Особенности тестирования веб-ориентированных приложений','ST02 Особенности тестирования веб-ориентированных приложений','ST02',10,0,'Вы полны сил и решимости узнать, как тестируют веб-приложения, как работают сайты и почему за веб-приложениями будущее? А может, Вы уже работали тестировщиком, но решили развиваться и учиться дальше? Именно для таких людей и создан данный курс.',36),(10,41,3010,'Функциональное тестирование','ST03 Функциональное тестирование','ST03',20,0,'Вы почти специалист, чувствуете себя неуверенно и хотите дошлифовать свои знания, узнать что-то большее в подходах тестирования и инструментарии - этот курс для Вас!',36),(11,42,4011,'Автоматизированное тестирование для начинающих','ST04  Автоматизированное тестирование для начинающих','ST04 ',30,0,'Вы научитесь: а) использовать на начальном профессиональном уровне популярные средства автоматизации тестирования; б) формировать и выполнять автоматизированные тесты; в) составлять отчёты о результатах автоматизированного тестирования.\r\n',36),(12,42,5012,'Автоматизация тестирования с использованием Java','ST05 Автоматизация тестирования с использованием Java','ST05',30,0,'Вы научитесь: а) создавать модульные тесты с использованием JUnit и TestNG; б) использовать Selenium RC/WebDriver и HtmlUnit для тестирования веб-ориентированных приложений; в) формировать и реализовывать стратегию автоматизированного тестирования.\r\n',36),(26,65,4027,'СУБД MySQL','PD02 СУБД MySQL','PD02',30,1,'Базы данных нужны практически любому сайту. В них можно хранить всё: информацию о пользователях, сообщения форумов, данные о заказах, аудио и видеозаписи и т.п. И всё это обилие данных можно не только хранить, но обрабатывать с использованием СУБД MySQL. ',44),(13,-1,13,'',' ','',0,0,'',0),(16,43,1016,'C++. Алгоритмизация','CD01 C++. Алгоритмизация','CD01',10,0,'Этот курс становится началом для погружения в мощный и очень техничный язык программирования С++.  \r\nИменно здесь раскрываются скрытые во многих языках высокого уровня внутренние механизмы работы с системными составляющими компьютера, такими, как память. Изучая ЭТОТ язык, Вы уже никогда не сможете сказать, что программирование - это \"пляски с бубнами\". Вы твердо убедитесь в том, что это мощное средство для изложения своих мыслей.',40),(17,43,2017,'C++. Объектно-ориентированное программирование','CD02 C++. Объектно-ориентированное программирование','CD02',20,0,'Курс является логическим продолжением базового, но бОльший акцент в нем делается на создание собственных решений, разработку библиотек, использование пользовательских типов данных. Вы будете не только строить из готовых блоков, но и проектировать решение, а также создавать эти строительные блоки. Именно в этом курсе Вы начнете творить и разговаривать на языке С++.\r\n',40),(18,43,3018,'C++. Стандартная библиотека шаблонов STL','CD03 C++. Стандартная библиотека шаблонов STL','CD03',30,0,'Это завершающий курс цикла и самый серьёзный и насыщенный. Сегодня программирование - это мир объектов. Они живут, умирают и взаимодействуют. Этот курс посвящен ООП (объектно-ориентированному программированию). С++ - это один из первых объектно-ориентированных языков, который вобрал в себя мощность языка С как языка среднего уровня, расширив парадигму абстрактных типов данных различными механизмами, такими как, наследование и динамическое связывание. Эти знания раздвигают горизонты и позволяют Вам заниматься искусством.',40),(14,45,1014,'Программирование на C#. Базовый уровень','Программирование на ND01 C#. Базовый уровень','ND01',10,0,'Перед тем как использовать основные возможности языка программирования C# и платформы .NET Framework, необходимо познакомиться с архитектурой платформы .NET Framework, синтаксисом языка программирования C#, получить базовые навыки разработки программ на языке C#, научиться отладке программ посредством Microsoft Visual Studio.',36),(15,45,2015,'Программирование на C#. Углубленный уровень','Программирование на ND02 C#. Углубленный уровень','ND02',20,0,'На этом курсе вы научитесь:\r\n- применять основные функциональные возможности, предоставляемые платформой .NET Framework для разработки объектно-ориентированных приложений;\r\n- организовывать работу с потоками данных;\r\n- применять объекты синхронизации при разработке многопоточных приложений.\r\n',36),(19,-1,19,'',' ','',0,0,'',0),(20,46,3020,'Разработка приложений на ASP.NET. Базовый уровень','ND03 Разработка приложений на ASP.NET. Базовый уровень','ND03',20,0,'ASP.NET — технология создания web-приложений и веб-сервисов от компании Microsoft. \r\n\r\n',36),(21,46,4021,'Разработка приложений на ASP.NET. Углубленный уровень','ND04 Разработка приложений на ASP.NET. Углубленный уровень','ND04',20,0,'В этой части курса Вы изучите основы технологии Silverlight, научитесь настраивать Microsoft Internet Information Services, создавать и использовать web-сервисы при разработке приложений, а также тестировать приложения с помощью инструментов Microsoft Visual Studio.',36),(22,-1,7052,'Английский для IT. Elementary+','EN1 Английский для IT. Elementary+','EN1',10,7,'\r\n',80),(23,-1,23,'',' ','',0,0,'',0),(24,47,1024,'Разработка веб-сайтов с использованием HTML, CSS','FE01 Разработка веб-сайтов с использованием HTML, CSS','FE01',10,1,'Этот курс будем вам полезен, если вы хотите:\r\nа) научиться верстать страницы с нуля;\r\nб) настраивать готовые шаблоны страниц;\r\nв) создавать веб-приложения на PHP, Java, ASP.NET.\r\nИ даже если вы \"всего лишь\" занимаетесь публикацией контента на сайте, вам зачастую не обойтись без знания языков разметки и навыков веб-верстки.\r\n ',72),(25,47,2025,'JavaScript. Базовый уровень','FE02 JavaScript. Базовый уровень','FE02',10,1,'Сейчас уже никого не удивить страницами, на которых можно выполнить множество разных действий, и данные на которой обновляются динамически, без перезагрузки страницы. А так ли это просто? Узнаете на этом курсе!',28),(27,65,7065,'Программирование на PHP. Углубленный курс','PD03 Программирование на PHP. Углубленный курс','PD03',30,1,'Если Вы уже умеете сверстать любой макет, который принесет Вам дизайнер, и спроектировать любую базу данных, которая способна легко и быстро отвечать на любой запрос-каприз Вашего клиента, самое время позаботиться о той части Вашего проекта, которая находится на стороне сервера.',44),(28,-1,28,'',' ','',0,0,'',0),(29,44,1029,'Базовые навыки бизнес-анализа','BA01 Базовые навыки бизнес-анализа','BA01',10,3,'Бизнес-аналитик - кто он, зачем, что он делает в ИТ-проекте? А главное - как он это делает? Какие использует методы и технологии? Примерить на себя эту роль вам поможет этот курс.',16),(30,44,3031,'Управление требованиями','BA03 Управление требованиями','BA03',20,3,'Как узнать, чего на самом деле хочет заказчик? Для этого надо понять, как устроены его бизнес-процессы - тогда станет понятно, как эти процессы поможет оптимизировать программный продукт и разработать требования к этому программному продукту. Именно это вы научитесь делать на данном курсе.',44),(31,44,2030,'Эффективные коммуникации','BA02 Эффективные коммуникации','BA02',20,3,'Возможно, одна из главных компетенций настоящего бизнес-аналитика - это эффективные, убеждающие коммуникации. С заказчиком и с командой проекта. Очные и онлайновые. Устные и письменные. Научиться этому можно на интерактивных занятиях этого курса.',24),(32,44,4032,'Практикум бизнес-анализа','BA04 Практикум бизнес-анализа','BA04',30,3,'Никакой теории - только практика! Весь курс Вы ведете проект - от самого его начала до логического завершения. Все, что было изучено на предыдущих курсах программы - все придется применить, углубить и расширить в этом курсе. ',36),(36,40,4036,'Технологии разработки enterprise-решений на Java. Базовый уровень','JD04 Технологии разработки enterprise-решений на Java. Базовый уровень','JD04',20,1,'',36),(33,-1,7059,'Рационально унифицированный процесс (RUP)','MM01 Рационально унифицированный процесс (RUP)','MM01',20,3,'RUP-методология (Rational Unified Process) представляет собой традиционный подход к организации работы проектной команды. ',36),(37,40,5037,'Технологии разработки enterprise-решений на Java. Углубленный уровень ','JD05 Технологии разработки enterprise-решений на Java. Углубленный уровень','JD05',20,1,'',36),(34,-1,7063,'Методология управления Agile Scrum','MM02 Методология управления Agile Scrum','MM02',20,3,'Scrum – это гибкий подход к разработке программных продуктов. Вместо того чтобы детально описывать  весь процесс разработки, как все взаимодействует и работает в рамках проекта, Scrum позволяет команде самой решать, как же выполнять работу максимально эффективно - ведь команда лучше других знает, как решать проблемы, которые перед ней стоят.',36),(35,-1,-7,'Практикум Java-разработки','JD3 Практикум Java-разработки','JD3',30,1,'Данный курс-практикум предусматривает работу слушателей в командах с четко разделенными обязанностями и ответственностью по выполнению конкретных задач. Командная работа организуется в соответствии с методологией Agile Scrum.',180),(3